import "@uniswap/v3-core/contracts/interfaces/callback/IUniswapV3SwapCallback.sol";
import "./ITriangularArbitrageOnUniswapV3.sol";

/**
 * 三角套利
 */
contract TriangularArbitrageOnUniswapV3 is
    ITriangularArbitrageOnUniswapV3,
    Ownable,
    IUniswapV3SwapCallback
{
    /// @dev The minimum tick that may be passed to #getSqrtRatioAtTick computed from log base 1.0001 of 2**-128
    int24 internal constant MIN_TICK = -887272;
    /// @dev The maximum tick that may be passed to #getSqrtRatioAtTick computed from log base 1.0001 of 2**128
    int24 internal constant MAX_TICK = -MIN_TICK;
    // v3 工厂合约
    address immutable v3FactoryAddress;
    // 白名单地址，只有在此白名单中的的地址，才允许调用
    mapping(address => bool) private whiteList;
    // 存储地址，最多存储64个
    address[] private existsWhiteAddressList;

    // 最多存储 64 个地址
    uint8 private constant MAX_LENGTH = 64;

    // 锁定状态
    bool private locked = false;
    // 最大滑点空间
    uint8 private constant MAX_SPACING_LENGTH = 10;
    // 余额 token->address->balance
    mapping(address => mapping(address => uint256)) private whiteListBalances;

    // 已经充值的token 列表
    address[] private depositTokenList;

    /// @notice pool 池
    struct PoolToken {
        address fromAddress;
        address toAddress;
        IUniswapV3Pool pool;
        address poolAddress;
        bool negative;
        address token0;
        address token1;
    }
    /// @notice  token pair
    struct TokenPair {
        address token0;
        address token1;
        address pool;
    }

    constructor(address _v3FactoryAddress) {
        v3FactoryAddress = _v3FactoryAddress;
        // 设置 owner 为 白名单用户
        whiteList[_msgSender()] = true;
    }

    // 限制白名单
    modifier _whiteList() {
        require(whiteList[_msgSender()], "current address is forbidden");
        _;
    }

    // 锁定检查
    modifier _checkLocked() {
        require(!locked, "current trasaction is locked!");
        locked = true;
        _;
        locked = false;
    }

    /// @notice 添加一个白名单地址
    /// @param whiteAddress 需要添加的白名单地址
    function addWhiteAddress(address whiteAddress) external override onlyOwner {
        require(whiteAddress != address(0));
        require(!whiteList[whiteAddress], "current white addres is exists");
        require(existsWhiteAddressList.length < MAX_LENGTH);
        _addWhiteAddress(whiteAddress);
        emit AddWhiteAddress(whiteAddress);
    }

    /// @notice 添加一个白名单地址
    /// @param whiteAddress 需要添加的白名单地址
    function _addWhiteAddress(address whiteAddress) internal {
        whiteList[whiteAddress] = true;
        existsWhiteAddressList.push(whiteAddress);
    }

    /// @notice 批量获取币对价格
    function getPairTicks(
        address[] calldata poolAddress,
        uint16 tickSapcingOffset
    ) external view override returns (PoolPairOuput[] memory prices) {
        require(poolAddress.length > 0, "LT0");
        require(tickSapcingOffset > 0 && tickSapcingOffset <= 200, "OFF0-200");
        prices = new PoolPairOuput[](poolAddress.length);
        for (uint8 i = 0; i < poolAddress.length; i++) {
            IUniswapV3Pool pool = IUniswapV3Pool(poolAddress[i]);
            (uint160 sqrtPriceX96, int24 tick, , , , , ) = pool.slot0();
            int24 tickSpacing = pool.tickSpacing();
            PopulatedTick[] memory liquidties = _evalPopulatedTicks(
                pool,
                tick,
                tickSapcingOffset,
                tickSpacing
            );
            prices[i] = PoolPairOuput(
                sqrtPriceX96,
                tick,
                pool.tickSpacing(),
                liquidties
            );
        }
    }

    // 计算 ticks
    function _evalPopulatedTicks(
        IUniswapV3Pool pool,
        int24 tick,
        uint16 tickSapcingOffset,
        int24 tickSpacing
    ) internal view returns (PopulatedTick[] memory liquidties) {
        // 计算 tick 对应的 bit map tick
        int24 currentTick = _floor(tick, tickSpacing);

        // 计算最小 start tick
        int24 startTick = currentTick - tickSapcingOffset * tickSpacing;
        startTick = startTick > MIN_TICK
            ? startTick
            : _floor(MIN_TICK, tickSpacing);

        // 计算 endTick =
        int24 endTick = currentTick + tickSapcingOffset * tickSpacing;
        endTick = endTick < MAX_TICK ? endTick : _floor(MAX_TICK, tickSpacing);
        // 计算 质押量
        liquidties = _getPopulatedTicksInWord(
            pool,
            tickSpacing,
            startTick,
            endTick
        );
    }

    // 计算 ticks
    function _getPopulatedTicksInWord(
        IUniswapV3Pool pool,
        int24 tickSpacing,
        int24 startTick,
        int24 endTick
    ) internal view returns (PopulatedTick[] memory populatedTicks) {
        require(endTick > startTick, "SELT");
        // calculate the number of populated ticks
        uint256 numberOfPopulatedTicks = uint256(
            (endTick - startTick) / tickSpacing + 1
        );

        // fetch populated tick data
        populatedTicks = new PopulatedTick[](numberOfPopulatedTicks);
        for (uint16 i = 0; i < numberOfPopulatedTicks; i++) {
            int24 populatedTick = startTick + int24(i) * tickSpacing;
            (uint128 liquidityGross, int128 liquidityNet, , , , , , ) = pool
            .ticks(populatedTick);
            populatedTicks[i] = PopulatedTick({
                tick: populatedTick,
                liquidityNet: liquidityNet,
                liquidityGross: liquidityGross
            });
        }
    }

    function uniswapV3SwapCallback(
        int256 amount0Delta,
        int256 amount1Delta,
        bytes calldata data
    ) external override {
        TokenPair memory decoded = abi.decode(data, (TokenPair));
        require(msg.sender == address(decoded.pool));
        if (amount0Delta > 0)
            SafeERC20.safeTransfer(
                IERC20(decoded.token0),
                msg.sender,
                uint256(amount0Delta)
            );
        if (amount1Delta > 0)
            SafeERC20.safeTransfer(
                IERC20(decoded.token1),
                msg.sender,
                uint256(amount1Delta)
            );
    }

    /// @notice 移除一个白名单
    /// @param whiteAddress 需要删除的地址
    function removeWhiteAddress(address whiteAddress)
        external
        override
        onlyOwner
    {
        require(whiteAddress != address(0));
        require(whiteList[whiteAddress], "current white addres is not exists");
        delete whiteList[whiteAddress];
        delete existsWhiteAddressList[
            uint256(_indexOf(existsWhiteAddressList, whiteAddress, true))
        ];
        // 重置所有改地址的所有币种金额
        for (uint8 i = 0; i < depositTokenList.length; i++) {
            delete whiteListBalances[depositTokenList[i]][whiteAddress];
        }
        emit RemoveWhiteAddress(whiteAddress);
    }

    /// @notice 清空白名单
    function clearWhiteAddress() external override onlyOwner {
        _clearWhiteAddress(address(0));
        emit ClearWhiteAddress();
    }

    // 清空 白名单地址
    function _clearWhiteAddress(address token) private {
        address _deletAddress;
        while (existsWhiteAddressList.length > 0) {
            _deletAddress = existsWhiteAddressList[
                existsWhiteAddressList.length - 1
            ];
            // 动态数组，只能通过 pop
            existsWhiteAddressList.pop();
            delete whiteList[_deletAddress];
            if (token == address(0)) {
                // 重置所有改地址的所有币种金额
                for (uint8 i = 0; i < depositTokenList.length; i++) {
                    delete whiteListBalances[depositTokenList[i]][
                        _deletAddress
                    ];
                }
            } else {
                delete whiteListBalances[token][_deletAddress];
            }
        }
        // 将 owner 加进去
        _addWhiteAddress(owner());
    }

    /// @notice 充值
    function deposit(address token, uint160 amount)
        external
        override
        _whiteList
        _checkLocked
    {
        require(amount > 0, "AERROR");
        /// 先检查余额
        // IERC20 token20 = IERC20(token);
        require(IERC20(token).balanceOf(_msgSender()) >= amount, "ABII");
        SafeERC20.safeTransferFrom(
            IERC20(token),
            msg.sender,
            address(this),
            uint256(amount)
        );
        uint256 bal = whiteListBalances[token][_msgSender()];
        if (_indexOf(depositTokenList, token, false) == -1) {
            depositTokenList.push(token);
        }
        if (bal == 0) {
            whiteListBalances[token][_msgSender()] = amount;
        } else {
            whiteListBalances[token][_msgSender()] = SafeMath.add(bal, amount);
        }
    }

    /// @notice 提现
    function withdraw(
        address token,
        address to,
        uint160 amount
    ) external override onlyOwner _checkLocked {
        require(amount > 0, "AERROR");
        require(to != address(this) && to != token, "SERROR");
        IERC20 tokenErc20 = IERC20(token);
        require(tokenErc20.balanceOf(address(this)) >= amount, "ABII");
        uint256 bal = whiteListBalances[token][to];
        require(bal >= amount, "CABII");
        SafeERC20.safeTransfer(tokenErc20, to, amount);
        if (bal > amount) {
            whiteListBalances[token][to] = SafeMath.sub(bal, amount);
        } else {
            delete whiteListBalances[token][to];
        }
    }

    function getAccountBalance(address token)
        external
        view
        override
        _whiteList
        returns (uint256)
    {
        return whiteListBalances[token][_msgSender()];
    }

    function getAllBalance(address token)
        external
        view
        override
        onlyOwner
        returns (uint256)
    {
        return IERC20(token).balanceOf(address(this));
    }

    function withdrawAll(address token)
        external
        override
        returns (uint256 amount)
    {
        amount = IERC20(token).balanceOf(address(this));
        SafeERC20.safeTransfer(IERC20(token), owner(), amount);
        // 清空地址
        _clearWhiteAddress(token);
    }

    /// 计算地址
    function _indexOf(
        address[] storage addressList,
        address findAddress,
        bool required
    ) internal view returns (int16 index) {
        for (uint8 i = 0; i < addressList.length; i++) {
            if (addressList[i] == findAddress) {
                return i;
            }
        }
        require(!required, "ADS404");
        return -1;
    }

    /// @notice 获取当前白名单地址列表
    /// @param checker 需要检查的地址
    /// @return 结果，true 是白名单，false 不是白名单
    function isWhiteAddress(address checker)
        external
        view
        override
        onlyOwner
        returns (bool)
    {
        return whiteList[checker];
    }

    /// @notice 根据填入的poolAddresList，来进行套利，poolAddresList 必须是一个闭环,A -> B -> ... -> A，顺序代表了交易路径
    /// @param token tokenA 的合约地址
    /// @param poolAddressList pool 地址，必须和 tokens 匹配
    /// @param amount 本地需要借贷/交易的金额
    /// @param minProfit 最小收益金额，单位是 token list 第一个 币的单位
    function arbitrage(
        address token,
        address[] calldata poolAddressList,
        uint160 amount,
        uint160 minProfit
    ) external override _whiteList _checkLocked {
        // 检查 token 和 poolAddresList
        require(poolAddressList.length > 2, "pool list must than gress 2");
        IERC20 tokenErc20 = IERC20(token);
        // 就算 pool
        PoolToken[] memory pools = new PoolToken[](poolAddressList.length);
        // 1、获取 pool
        address toTokenAddress = token;
        PoolToken memory pool;

        for (uint8 i = 0; i < poolAddressList.length; i++) {
            pool = _evalPoolToken(toTokenAddress, poolAddressList[i]);
            pools[i] = pool;
            toTokenAddress = pool.toAddress;
        }
        address recipient = address(this);

        // 存储一开始的值
        uint256 balanceBefore = tokenErc20.balanceOf(recipient);

        require(balanceBefore >= amount, "ABII1");

        uint256 amountSpecified = amount;
        // 逐个处理
        for (uint8 i = 0; i < pools.length; i++) {
            pool = pools[i];
            amountSpecified = _swap(pool, amountSpecified, recipient);
        }
        // 检查最终余额
        uint256 tokenBalanceAfter = tokenErc20.balanceOf(recipient);

        // 检查是否亏损
        require(tokenBalanceAfter - balanceBefore >= minProfit, "ABII99");
        // 6、事件
        emit Arbitrage(
            recipient,
            token,
            amount,
            SafeMath.sub(tokenBalanceAfter, balanceBefore)
        );
    }

    /// @notice 交换方法
    /// @param pool 交易池
    /// @param amount 本次交易金额
    /// @param recipient 接受/交易地址
    function _swap(
        PoolToken memory pool,
        uint256 amount,
        address recipient
    ) internal returns (uint256 amountSpecified) {
        // 3、闪电贷 TODO 暂时不支持
        //if (isFlash) {
        //  pool.pool.flash(recipient, amount0, amount1, "");
        //}
        // 记录起始账户
        uint256 toBalanceBefore = IERC20(pool.toAddress).balanceOf(recipient);
        // 获取 tickspace
        int24 tickSpacing = pool.pool.tickSpacing();
        // 获取 tick
        (, int24 tick, , , , , ) = pool.pool.slot0();
        // 计算最大滑点，一个 space 空间
        int24 incrementTickSpacing = (
            pool.negative ? -tickSpacing : tickSpacing
        );
        uint160 sqrtPriceLimitX96 = _getSqrtRatioAtTick(
            _floor(tick, tickSpacing) +
                incrementTickSpacing *
                MAX_SPACING_LENGTH
        );
        // print swap
        emit PrintSwap(
            pool.fromAddress,
            pool.toAddress,
            pool.poolAddress,
            amount,
            sqrtPriceLimitX96
        );
        TokenPair memory tokenPair = TokenPair(
            pool.token0,
            pool.token1,
            pool.poolAddress
        );
        // 4、swap 交易
        pool.pool.swap(
            recipient,
            pool.negative,
            int256(amount),
            sqrtPriceLimitX96,
            abi.encode(tokenPair)
        );
        uint256 afterBalance = IERC20(pool.toAddress).balanceOf(recipient);
        require(afterBalance - toBalanceBefore > 0, "ABII3");
        // 5、计算 to address 增加的金额
        amountSpecified = SafeMath.sub(afterBalance, toBalanceBefore);
    }

    /// @dev Rounds tick down towards negative infinity so that it's a multiple
    /// of `tickSpacing`.
    function _floor(int24 tick, int24 tickSpacing)
        internal
        pure
        returns (int24)
    {
        int24 compressed = tick / tickSpacing;
        if (tick < 0 && tick % tickSpacing != 0) compressed--;
        return compressed * tickSpacing;
    }

    function _evalPoolToken(address tokenAddress, address poolAddress)
        internal
        view
        returns (PoolToken memory poolToken)
    {
        IUniswapV3Pool pool = IUniswapV3Pool(poolAddress);
        address token0 = pool.token0();
        address token1 = pool.token1();
        require(
            token0 == tokenAddress || token1 == tokenAddress,
            "pool address is error"
        );

        // TODO 检查合约是否存在
        poolToken = PoolToken(
            token0 == tokenAddress ? token0 : token1,
            token1 == tokenAddress ? token0 : token1,
            pool,
            poolAddress,
            token0 == tokenAddress,
            token0,
            token1
        );
    }

    /// 转账
    function _safeTransfer(
        IERC20 token,
        address from,
        address to,
        uint256 amount
    ) internal {
        uint256 balance = token.balanceOf(from);
        require(balance >= amount, "ABII");
        // 开始转账
        // token.transferFrom(from, address(to), amount);
        SafeERC20.safeTransferFrom(token, from, address(to), amount);
    }

    function _getSqrtRatioAtTick(int24 tick)
        internal
        pure
        returns (uint160 sqrtPriceX96)
    {
        uint256 absTick = tick < 0
            ? uint256(-int256(tick))
            : uint256(int256(tick));
        require(absTick <= uint256(MAX_TICK), "T");

        uint256 ratio = absTick & 0x1 != 0
            ? 0xfffcb933bd6fad37aa2d162d1a594001
            : 0x100000000000000000000000000000000;
        if (absTick & 0x2 != 0)
            ratio = (ratio * 0xfff97272373d413259a46990580e213a) >> 128;
        if (absTick & 0x4 != 0)
            ratio = (ratio * 0xfff2e50f5f656932ef12357cf3c7fdcc) >> 128;
        if (absTick & 0x8 != 0)
            ratio = (ratio * 0xffe5caca7e10e4e61c3624eaa0941cd0) >> 128;
        if (absTick & 0x10 != 0)
            ratio = (ratio * 0xffcb9843d60f6159c9db58835c926644) >> 128;
        if (absTick & 0x20 != 0)
            ratio = (ratio * 0xff973b41fa98c081472e6896dfb254c0) >> 128;
        if (absTick & 0x40 != 0)
            ratio = (ratio * 0xff2ea16466c96a3843ec78b326b52861) >> 128;
        if (absTick & 0x80 != 0)
            ratio = (ratio * 0xfe5dee046a99a2a811c461f1969c3053) >> 128;
        if (absTick & 0x100 != 0)
            ratio = (ratio * 0xfcbe86c7900a88aedcffc83b479aa3a4) >> 128;
        if (absTick & 0x200 != 0)
            ratio = (ratio * 0xf987a7253ac413176f2b074cf7815e54) >> 128;
        if (absTick & 0x400 != 0)
            ratio = (ratio * 0xf3392b0822b70005940c7a398e4b70f3) >> 128;
        if (absTick & 0x800 != 0)
            ratio = (ratio * 0xe7159475a2c29b7443b29c7fa6e889d9) >> 128;
        if (absTick & 0x1000 != 0)
            ratio = (ratio * 0xd097f3bdfd2022b8845ad8f792aa5825) >> 128;
        if (absTick & 0x2000 != 0)
            ratio = (ratio * 0xa9f746462d870fdf8a65dc1f90e061e5) >> 128;
        if (absTick & 0x4000 != 0)
            ratio = (ratio * 0x70d869a156d2a1b890bb3df62baf32f7) >> 128;
        if (absTick & 0x8000 != 0)
            ratio = (ratio * 0x31be135f97d08fd981231505542fcfa6) >> 128;
        if (absTick & 0x10000 != 0)
            ratio = (ratio * 0x9aa508b5b7a84e1c677de54f3e99bc9) >> 128;
        if (absTick & 0x20000 != 0)
            ratio = (ratio * 0x5d6af8dedb81196699c329225ee604) >> 128;
        if (absTick & 0x40000 != 0)
            ratio = (ratio * 0x2216e584f5fa1ea926041bedfe98) >> 128;
        if (absTick & 0x80000 != 0)
            ratio = (ratio * 0x48a170391f7dc42444e8fa2) >> 128;

        if (tick > 0) ratio = type(uint256).max / ratio;

        // this divides by 1<<32 rounding up to go from a Q128.128 to a Q128.96.
        // we then downcast because we know the result always fits within 160 bits due to our tick input constraint
        // we round up in the division so getTickAtSqrtRatio of the output price is always consistent
        sqrtPriceX96 = uint160(
            (ratio >> 32) + (ratio % (1 << 32) == 0 ? 0 : 1)
        );
    }
}

